mutation CreateCompany($name: String!) {
  createCompany(name: $name) {
    __typename
    id
    name
  }
}

df2b23180ee5074ab30ede33cca188e281e54295.source:
query ArtistDetails($id: ID!) {
  artist(id: $id) {
    __typename
    ...ArtistInfo
    groups {
      __typename
      displayName
      secondaryDisplayName
      images {
        __typename
        cardFlat
      }
    }
    members {
      __typename
      displayName
      images {
        __typename
        icon
      }
    }
  }
}
